package com.gunjan.controller;

import com.sun.imageio.plugins.jpeg.JPEG;
import org.apache.tomcat.util.codec.binary.Base64;
import org.springframework.http.*;
import org.springframework.util.StreamUtils;
import org.springframework.web.bind.annotation.PathVariable;
import org.springframework.web.bind.annotation.RequestMapping;
import org.springframework.web.bind.annotation.RequestMethod;
import org.springframework.web.bind.annotation.RestController;

import javax.servlet.http.HttpServletResponse;
import java.io.ByteArrayInputStream;
import java.io.IOException;
import java.io.InputStream;
import java.io.OutputStream;

/**
 * Created by Gunjan Kumar on 4/10/2017.
 */
@RestController
public class ServiceController {
    private HttpHeaders responseHeaders = new HttpHeaders();
    @RequestMapping(value = "/service/v1/cdn",
            method = RequestMethod.GET,produces = MediaType.IMAGE_JPEG_VALUE)
    public ResponseEntity<?> getFile() throws IOException {
        String base64 = getBase64SampleData(); // get base-64 encoded string from db
        byte[] bytes = Base64.decodeBase64(base64);
        responseHeaders.setContentType(MediaType.IMAGE_JPEG);
        return new ResponseEntity(bytes,responseHeaders, HttpStatus.OK);
    }

    private String getBase64SampleData() {
        return "";
    }
}
